export function getIcon(
  name: string | undefined,
  className: string = "size-5"
) {
  if (!name || !(name in Icons)) return null;
  const Icon = Icons[name as keyof typeof Icons];
  return <Icon className={className} />;
}

export function getSidebarIcon(name: string, className: string = "size-5") {
  switch (name.toLowerCase()) {
    case "dashboard":
      return <Icons.dashboard className={className} />;
    case "graph":
      return <Icons.graph className={className} />;
    case "charger":
      return <Icons.charger className={className} />;
    case "notification_important":
      return <Icons.notification_important className={className} />;
    case "warning":
      return <Icons.warning className={className} />;
    case "account_circle":
      return <Icons.account_circle className={className} />;
    case "ticket":
      return <Icons.ticket className={className} />;
    default:
      return <Code2 className={className} />;
  }
}

export function getStatusIcon(
  status: "info" | "warning" | "error",
  className: string = "size-3"
) {
  switch (status) {
    case "info":
      return <Icons.info className={className} />;
    case "warning":
      return <Icons.warning className={className} />;
    case "error":
      return <Icons.notification_important className={className} />;
    default:
      return null;
  }
}

export function getMCPPowerLevelIcon(
  level: string,
  className: string = "h-26 w-6"
) {
  switch (level) {
    case "L1":
      return <Icons.mcb className={cn("text-[#FF3B30]", className)} />;
    case "L2":
      return <Icons.mcb_broken className={cn(className)} />;
    case "L3":
      return <Icons.mcb className={cn("text-[#007AFF]", className)} />;
    default:
      return null;
  }
}

export function getThermostatIcon(
  type: "external" | "charger" | "gun1" | "gun2" | "humidity1" | "humidity2",
  className: string = "size-4.5"
) {
  switch (type) {
    case "external":
      return <Icons.device_thermostat className={className} />;
    case "charger":
      return <Icons.device_charger className={className} />;
    case "gun1":
    case "gun2":
      return <Icons.device_gun className={className} />;
    case "humidity1":
    case "humidity2":
      return <Icons.device_humidity className={className} />;
    default:
      return null;
  }
}
